import React from "react";
import "./OuterBox.css";

function OuterBox(props) {
  if (props.image) {
    const image = <img src={props.image} alt={props.imageAlt} />;
  }
  if (props.title) {
    const titleText = <h2 className="OuterBoxTitle">{props.title}</h2>;
  }

  return (
    <div className="OuterBox">
      <div className="OuterBoxTop"></div>
    </div>
  );
}

export default OuterBox;
